	"sustainabilitypro/view/OrgStructure.view.xml":'<core:View\n\t\tcontrollerName="sustainabilitypro.controller.OrgStructure"\n\t\txmlns:core="sap.ui.core"\n\t\txmlns="sap.suite.ui.commons.networkgraph"\n\t\txmlns:layout="sap.suite.ui.commons.networkgraph.layout"\n\t\theight="100%"><Graph enableWheelZoom="false"\n\t\t   orientation="TopBottom"\n\t\t   nodes="{/nodes}"\n\t\t   lines="{/lines}"\n\t\t   layout="Layered"\n\t\t   searchSuggest="suggest"\n\t\t   search="search"\n\t\t   id="graph"><layoutAlgorithm><layout:LayeredLayout\n\t\t\t\t\tmergeEdges="true"\n\t\t\t\t\tnodePlacement="Simple"\n\t\t\t\t\tnodeSpacing="40"/></layoutAlgorithm><nodes><Node icon="sap-icon://action-settings"\n\t\t\t\t  key="{EmployeeID}"\n\t\t\t\t  description="{Position}"\n\t\t\t\t  title="{EmployeeName}"\n\t\t\t\t  width="90"\n\t\t\t\t  collapsed="{collapsed}"\n\t\t\t\t  attributes="{attributes}"\n\t\t\t\t  showActionLinksButton="false"\n\t\t\t\t  showDetailButton="false"\n\t\t\t\t  descriptionLineSize="0"\n\t\t\t\t  shape="Box"><customData><core:CustomData key="supervisor" value="{Supervisor}"/><core:CustomData key="TeamMembers" value="{TeamMembers}"/><core:CustomData key="CountryID" value="{CountryID}"/><core:CustomData key="Position" value="{Position}"/><core:CustomData key="TeamGoals" value="{TeamGoals}"/><core:CustomData key="GoalsAssigned" value="{GoalsAssigned}"/><core:CustomData key="Email" value="{Email}"/><core:CustomData key="ContactNumber" value="{ContactNumber}"/></customData><attributes><ElementAttribute label="{label}" value="{value}"/></attributes><image><NodeImage src="./utils/person-icon.png"\n\t\t\t\t\t\t\t   width="80"\n\t\t\t\t\t\t\t   height="80"/></image></Node></nodes><lines><Line from="{supervisor}" to="{employee}" arrowOrientation="None" press="linePress" /></lines></Graph></core:View>\n',
